import React, { useState } from 'react';

import { View, StyleSheet, TouchableOpacity, Platform, Button, Text } from 'react-native';

const API_URL = Platform.OS !== 'ios' ? 'http://localhost:5000' : 'http://10.0.2.2:5000';

const LearnScreen = ({ navigation }) => {

        return (
            <View style={styles.back}>
                <View style={styles.header}>
                    <Text style={styles.headerTitle}>Learn</Text>
                </View>
                <View>
                    <TouchableOpacity
                    style={styles.input}
                    onPress={() => {
                        navigation.navigate('TransposeScreens');
                    }}
                    > 
                    <Text style={{color: 'black', alignSelf: 'center', transform: 'translateY(-33%)'}}>Transposition</Text>
                    </TouchableOpacity>

                    <TouchableOpacity
                    style={styles.input}
                    >
                    <Text style={{color: 'black', alignSelf: 'center', transform: 'translateY(-33%)'}}>Harmonies</Text>
                    </TouchableOpacity>

                    <TouchableOpacity
                    style={styles.input}
                    
                    > 
                    <Text style={{color: 'black', alignSelf: 'center', transform: 'translateY(-33%)'}}>Filler</Text>
                    </TouchableOpacity>
                </View>
            </View>
        );
    };

    const styles = StyleSheet.create({
        input: {
            marginTop: '5%',
            marginLeft: '50%',
            marginRight: '50%',
            backgroundColor: 'darkgray',
            width: '200px',
            color: 'white',
            paddingTop: 10,
            fontSize: 16,
            minHeight: 30,
            alignSelf: 'center',
            borderRadius: '2.5',
        },
        header: {
            width: '100%',
            height: '10%',
            backgroundColor: '#EBEBEB',
            borderBottomWidth: '1px',
            borderBottomColor: 'black',
        },
        headerTitle: {
            color: 'black',
            fontWeight: 'bold',
            marginLeft: 'auto',
            marginRight: 'auto',
            marginBottom: 'auto',
            marginTop: 'auto',
            fontSize: '25px'
        },
        back: {
            width: '100%',
            height: '100%',
            backgroundColor: '#EBEBEB',
            overflow: 'hidden',
        },
    });

    export default LearnScreen;
